import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the featured products grid to be visible
    await page.waitForSelector('#productsGrid .product-card', { timeout: 5000 });

    // Locate the first product card in the featured products grid
    const firstProductCard = await page.$('#productsGrid .product-card');
    if (!firstProductCard) {
      throw new Error('First product card not found');
    }

    // Find the "Add to Cart" button inside the first product card
    const addToCartBtn = await firstProductCard.$('button.add-to-cart');
    if (!addToCartBtn) {
      throw new Error('"Add to Cart" button not found in first product card');
    }

    // Click the "Add to Cart" button
    await addToCartBtn.click();

    // Wait for the notification to appear
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take screenshot after adding to cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_added_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_added_to_cart.png'));

    // Extract cart count
    await page.waitForSelector('#cartCount', { timeout: 5000 });
    const cartCountText = await page.$eval('#cartCount', el => el.textContent.trim());

    // Extract notification message
    const notificationMsg = await page.$eval('.notification.success', el => el.textContent.trim());

    return {
      success: true,
      action: "Added the first product in the featured products grid to the cart",
      extractedData: {
        cartCount: cartCountText,
        notification: notificationMsg
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
